import React from 'react';

const EmojiImage = ({ emojis }) => {
	console.log(emojis);
	const fontSize = '6px';
	const height = window.innerWidth * 0.95;
	return (
		<div>
			{emojis.map((row, rowindex) => {
				return (
					<div key={'row:' + rowindex} style={{ padding: 0, height: '6px', width: '95%', height: { height } + '%', margin: '0 auto' }}>
						{row.map((emoji, index) => {
							return (
								<p
									key={rowindex + ':' + index}
									style={{ display: 'inline-block', margin: 0, padding: '1px', fontSize: 100 / row.length + 'em', width: 100 / row.length + '%', boxSizing: 'border-box' }}
								>
									{emoji === 'empty' ? '\u00A0' : emoji}
								</p>
							);
						})}
					</div>
				);
			})}
		</div>
	);
};

export default EmojiImage;
